package com.bzkj.swagger.apidoc;import org.springframework.context.annotation.Bean;import org.springframework.context.annotation.Configuration;import springfox.documentation.spring.web.plugins.Docket;import springfox.documentation.swagger2.annotations.EnableSwagger2;/** * @description: * @author: jensen * @date: created by 2019/9/11 11:17 */@Configuration@EnableSwagger2public class ApiDocs {    @Bean    public Docket Domp() {        return DompApis.docs();    }}